import React, { useEffect } from "react";
import ISidebarKeyValues from "../interfaces/ISidebarKeyValues";
import './Sidebar.scss';

type SidebarProps = {
  title: string,
  titleLink: string,
  sidebarItems: ISidebarKeyValues[]
}

const Sidebar = ({ title, titleLink, sidebarItems }: SidebarProps) => {

  let cardRows: Array<object> = [];

  for (let i: number = 0; i < storeDetails.length; i = i + 2) {
      cardRows.push(
          <div className='row no-gutters' key={i}>
              {
                  storeDetails.slice(i, i + 2).map(
                      (d) => {
                          return (
                              <div className='col d-flex justify-content-center' key={d.id} >
                              </div>
                          )
                      }
                  )
              }
          </div>
      )
  }

  return (
      <>
          <div className='center-content home mt-5'>
              {cardRows}
          </div>
      </>
  )
}

export default Sidebar;
